import React, { Component } from 'react'
import LeftArrowButton from './LeftArrowButton'
import RightArrowButton from './RightArrowButton'
// how could you pass the html escape key for an arrow as a prop here?
export default class WeekSelect extends Component {

  constructor() {
    super() 
    this.state = {
      weekStart: "4",
      weekEnd: "10"
    }
  }

  render() {
    const {weekStart} = this.state;
    const {weekEnd} = this.state;
    return (
      <div className="weekSelect">
        <LeftArrowButton />
        <h4 className="weekTitle">April {weekStart}-{weekEnd}</h4>
        <RightArrowButton />
      </div>
    )
  }
}
